function CreateNote() {
    return (
        <>
            <div className="note">
                <form>
                    <input type="text" placeholder="Title" />
                    <textarea rows="" column="" placeholder="write a note..."></textarea>

                </form>

            </div>

        </>
    )
}

export default CreateNote;
